const tableHeader = (props) => {
  return (
    <>
      <thead>
        <tr>
          {props.headers.map((header) => {
            return (
              <>
                <th>{header}</th>
              </>
            );
          })}
        </tr>
      </thead>
    </>
  );
};

export default tableHeader;
